import React, {useState , useEffict}  from "react";

function MovieList(){
const[Movies , setMovies] = useState([]);
useEffict(()=> {
fetch('https://developers.themoviedb.org/3') 
.then((response)=>response.json())
.then(data => {setMovies(data);
    console.log(data);
    });
    });


}
export default MovieList ;
